const calculator = (arr) => {
	var result = 0;
	var type = "";

	var index;
	for (index = 0; index < arr.length; ++index) {
		result += arr[index] * Math.pow(10, index);
	}
	// result = result + 99 * Math.pow(10, arr.length);

	const rand = Math.floor(Math.random() * 16);
	switch (rand) {
		case "0":
			type = "dentist";
		case "1":
			type = "developer";
		case "2":
			type = "employee";
		case "3":
			type = "flight";
		case "4":
			type = "freshmen";
		case "5":
			type = "hero";
		case "6":
			type = "hwata";
		case "7":
			type = "ingukgong";
		case 8:
			type = "karaoke";
		case 9:
			type = "mask";
		case 10:
			type = "pediatric";
		case 11:
			type = "poop";
		case 12:
			type = "surgeon";
		case 13:
			type = "travel";
		case 14:
			type = "unemployed";
		case 15:
			type = "youtuber";
		default:
			type = "hero";
	}

	return type;
};

export default calculator;
